import React from 'react';
import { File, FileText, Image, Music, Video, Archive, Loader2, Search } from 'lucide-react';

const ResultsList = ({ results, onResultSelect, selectedResult, isLoading, query }) => {
  const getFileIcon = (filename) => {
    const extension = filename.split('.').pop()?.toLowerCase();
    
    switch (extension) {
      case 'pdf':
      case 'doc':
      case 'docx':
      case 'txt':
      case 'md':
        return <FileText className="h-5 w-5 text-blue-500" />;
      case 'jpg':
      case 'jpeg':
      case 'png':
      case 'gif':
      case 'svg':
        return <Image className="h-5 w-5 text-green-500" />;
      case 'mp3':
      case 'wav':
      case 'flac':
        return <Music className="h-5 w-5 text-purple-500" />;
      case 'mp4':
      case 'avi':
      case 'mkv':
        return <Video className="h-5 w-5 text-red-500" />;
      case 'zip':
      case 'rar':
      case '7z':
        return <Archive className="h-5 w-5 text-orange-500" />;
      default:
        return <File className="h-5 w-5 text-gray-500" />;
    }
  };

  const highlightMatch = (text, query) => {
    if (!query) return text;
    
    const regex = new RegExp(`(${query.replace(/[.*+?^${}()|[\]\\]/g, '\\$&')})`, 'gi');
    const parts = text.split(regex);
    
    return parts.map((part, index) => 
      regex.test(part) ? (
        <mark key={index} className="bg-yellow-200 px-1 rounded">
          {part}
        </mark>
      ) : (
        part
      )
    );
  };

  const formatScore = (score) => {
    return Math.round(score * 100);
  };

  if (isLoading && results.length === 0) {
    return (
      <div className="h-full flex items-center justify-center bg-white">
        <div className="text-center">
          <Loader2 className="h-8 w-8 animate-spin text-gray-400 mx-auto mb-4" />
          <p className="text-gray-500">Searching...</p>
        </div>
      </div>
    );
  }

  if (!query && results.length === 0) {
    return (
      <div className="h-full flex items-center justify-center bg-white">
        <div className="text-center text-gray-500">
          <Search className="h-12 w-12 mx-auto mb-4 text-gray-300" />
          <p className="text-lg mb-2">Search your files</p>
          <p className="text-sm">Enter a query to find relevant documents</p>
        </div>
      </div>
    );
  }

  if (results.length === 0) {
    return (
      <div className="h-full flex items-center justify-center bg-white">
        <div className="text-center text-gray-500">
          <FileText className="h-12 w-12 mx-auto mb-4 text-gray-300" />
          <p className="text-lg mb-2">No results found</p>
          <p className="text-sm">Try a different search query</p>
        </div>
      </div>
    );
  }

  return (
    <div className="h-full overflow-y-auto bg-white">
      <div className="p-4 border-b border-gray-200 bg-gray-50">
        <p className="text-sm text-gray-600">
          {results.length} result{results.length !== 1 ? 's' : ''} for "{query}"
        </p>
      </div>
      
      <div className="divide-y divide-gray-200">
        {results.map((result) => (
          <div
            key={result.id}
            onClick={() => onResultSelect(result)}
            className={`p-4 cursor-pointer hover:bg-gray-50 transition-colors ${
              selectedResult?.id === result.id ? 'bg-blue-50 border-r-2 border-blue-500' : ''
            }`}
          >
            <div className="flex items-start space-x-3">
              <div className="flex-shrink-0 mt-1">
                {getFileIcon(result.filename)}
              </div>
              
              <div className="flex-1 min-w-0">
                <div className="flex items-center justify-between">
                  <h3 className="text-sm font-medium text-gray-900 truncate">
                    {highlightMatch(result.filename, query)}
                  </h3>
                  {result.score && (
                    <span className="text-xs text-gray-500 ml-2">
                      {formatScore(result.score)}%
                    </span>
                  )}
                </div>
                
                <p className="text-xs text-gray-500 truncate mt-1">
                  {result.path}
                </p>
                
                {result.snippet && (
                  <p className="text-sm text-gray-700 mt-2 line-clamp-2">
                    {highlightMatch(result.snippet, query)}
                  </p>
                )}
                
                {result.modified && (
                  <p className="text-xs text-gray-400 mt-2">
                    Modified {new Date(result.modified).toLocaleDateString()}
                  </p>
                )}
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ResultsList;
